import { useState, useEffect, useMemo, useCallback, memo } from 'react';
import PropTypes from 'prop-types';
import './styles.css';

// ==================== CONSTANTS ====================
const SINGAPORE_PHONE_REGEX = /\b([3689]\d{3})[ -]?(\d{4})\b/g;
const PHONE_NUMBER_LENGTH = 8;
const VISIBLE_DIGITS = 4;

// ==================== UTILITIES ====================
/**
 * Formats phone number with space separator
 * @param {string} digits - Phone number digits
 * @returns {string} Formatted phone number
 */
const formatPhoneNumber = (digits) => {
  if (digits.length === PHONE_NUMBER_LENGTH) {
    return digits.replace(/(\d{4})(\d{4})/, '$1 $2');
  }
  return digits;
};

/**
 * Anonymizes phone number
 * @param {string} digits - Phone number digits
 * @returns {string} Anonymized phone number
 */
const anonymizePhoneNumber = (digits) => {
  return `${digits.slice(0, VISIBLE_DIGITS)} XXXX`;
};

/**
 * Extracts digits from phone number string
 * @param {string} number - Phone number with possible formatting
 * @returns {string} Digits only
 */
const extractDigits = (number) => {
  return (number || '').replace(/\D/g, '');
};

// ==================== CUSTOM HOOKS ====================
/**
 * Custom hook for managing description visibility with SEO optimization
 * @returns {Object} Description visibility state and handlers
 */
const useDescriptionVisibility = () => {
  const [isDescriptionVisible, setIsDescriptionVisible] = useState(false);
  const [shouldHideInitially, setShouldHideInitially] = useState(false);
  
  useEffect(() => {
    setShouldHideInitially(true);
  }, []);
  
  const toggleDescription = useCallback(() => {
    setIsDescriptionVisible((prev) => !prev);
  }, []);
  
  const displayDescription = !shouldHideInitially || isDescriptionVisible;
  
  return {
    isDescriptionVisible,
    displayDescription,
    toggleDescription
  };
};

/**
 * Custom hook for phone number reveal state
 * @returns {Object} Reveal state and handlers
 */
const usePhoneReveal = () => {
  const [isRevealed, setIsRevealed] = useState(false);
  
  const handleReveal = useCallback(() => {
    setIsRevealed(true);
  }, []);
  
  const handleKeyDown = useCallback((e) => {
    if (e.key === 'Enter' || e.key === ' ') {
      e.preventDefault();
      setIsRevealed(true);
    }
  }, []);
  
  return {
    isRevealed,
    handleReveal,
    handleKeyDown
  };
};

// ==================== COMPONENTS ====================
/**
 * PhoneNumber Component
 * Renders a phone number with click-to-reveal functionality
 */
const PhoneNumber = memo(({ number }) => {
  const { isRevealed, handleReveal, handleKeyDown } = usePhoneReveal();
  
  if (!number) return null;
  
  const digits = extractDigits(number);
  const anonymized = anonymizePhoneNumber(digits);
  const formatted = formatPhoneNumber(digits);

  return (
    <span 
      className="phone-number"
      onClick={handleReveal}
      role="button"
      tabIndex={0}
      onKeyDown={handleKeyDown}
      style={{ 
        cursor: isRevealed ? 'default' : 'pointer',
        textDecoration: 'none',
        color: isRevealed ? 'inherit' : '#2563EB'
      }}
    >
      {isRevealed ? formatted : anonymized}
    </span>
  );
});

PhoneNumber.displayName = 'PhoneNumber';

PhoneNumber.propTypes = {
  number: PropTypes.string
};

/**
 * Parses text and replaces phone numbers with PhoneNumber components
 */
const parsePhoneNumbers = (text) => {
  if (!text) return [];
  
  SINGAPORE_PHONE_REGEX.lastIndex = 0;
  
  const parts = [];
  let lastIndex = 0;
  let match;

  while ((match = SINGAPORE_PHONE_REGEX.exec(text)) !== null) {
    if (match.index > lastIndex) {
      parts.push(text.slice(lastIndex, match.index));
    }
    
    parts.push(
      <PhoneNumber key={`phone-${match.index}`} number={match[0]} />
    );
    
    lastIndex = match.index + match[0].length;
  }
  
  if (lastIndex < text.length) {
    parts.push(text.slice(lastIndex));
  }
  
  return parts;
};

/**
 * ImageGallery Component - Handles image display and navigation
 */
const ImageGallery = memo(({ pic, title, flag, arrow_left, arrow_right }) => {
  const handlePrevious = useCallback(() => {
    // Add navigation logic here
    console.log('Navigate to previous image');
  }, []);
  
  const handleNext = useCallback(() => {
    // Add navigation logic here
    console.log('Navigate to next image');
  }, []);
  
  return (
    <div className="imageContainer">
      {flag && <img className="flag" src={flag} alt="Featured listing" />}
      <img className="mainPic" src={pic} alt={title} />
      
      <button 
        className="arrowBtn arrowLeft"
        aria-label="Previous image"
        onClick={handlePrevious}
      >
        <img src={arrow_left} alt="" />
      </button>
      <button 
        className="arrowBtn arrowRight"
        aria-label="Next image"
        onClick={handleNext}
      >
        <img src={arrow_right} alt="" />
      </button>
    </div>
  );
});

ImageGallery.displayName = 'ImageGallery';

ImageGallery.propTypes = {
  pic: PropTypes.string.isRequired,
  title: PropTypes.string.isRequired,
  flag: PropTypes.string,
  arrow_left: PropTypes.string.isRequired,
  arrow_right: PropTypes.string.isRequired
};

/**
 * PropertyInfo Component - Displays property details
 */
const PropertyInfo = memo(({ 
  icon, 
  title, 
  address, 
  project_type, 
  year, 
  ownership_type, 
  availabilities_label 
}) => (
  <div className="leftContent">
    <div className="leftTopContent">
      <img 
        className="icon" 
        width="40" 
        height="40" 
        src={icon} 
        alt="" 
        aria-hidden="true"
      />
      <div className="textLeftTopContent">
        <h1 className="title">{title}</h1>
        <p className="address">{address}</p>
      </div>
    </div>
    
    <div className="leftBotContent">
      <p className="labelTop">
        {project_type} · {year} · {ownership_type}
      </p>
      <p className="labelBot">{availabilities_label}</p>
    </div>
  </div>
));

PropertyInfo.displayName = 'PropertyInfo';

PropertyInfo.propTypes = {
  icon: PropTypes.string.isRequired,
  title: PropTypes.string.isRequired,
  address: PropTypes.string.isRequired,
  project_type: PropTypes.string.isRequired,
  year: PropTypes.oneOfType([PropTypes.string, PropTypes.number]).isRequired,
  ownership_type: PropTypes.string.isRequired,
  availabilities_label: PropTypes.string.isRequired
};

/**
 * PriceInfo Component - Displays pricing information
 */
const PriceInfo = memo(({ price, subprice_label }) => (
  <div className="rightContent">
    <div className="price">
      <h1>{price}</h1>
    </div>
    <p className="priceFrom">{subprice_label}</p>
  </div>
));

PriceInfo.displayName = 'PriceInfo';

PriceInfo.propTypes = {
  price: PropTypes.string.isRequired,
  subprice_label: PropTypes.string.isRequired
};

/**
 * Description Component - Displays property description with phone parsing
 */
const Description = memo(({ description, isVisible }) => {
  const descriptionLines = useMemo(() => {
    return String(description || '')
      .replace(/\r\n?/g, '\n')
      .split('\n')
      .filter((line) => line.trim());
  }, [description]);
  
  return (
    <div 
      className={`descriptionSection ${isVisible ? 'visible' : ''}`}
      aria-hidden={!isVisible}
    >
      <div className="description">
        {descriptionLines.map((line, index) => (
          <p key={`desc-${index}`} className="descriptionText">
            {parsePhoneNumbers(line)}
          </p>
        ))}
      </div>
    </div>
  );
});

Description.displayName = 'Description';

Description.propTypes = {
  description: PropTypes.string,
  isVisible: PropTypes.bool.isRequired
};

// ==================== MAIN COMPONENT ====================
/**
 * ListingAd Component
 * Main component for displaying property listing advertisement
 */
function ListingAd(props) {
  const {
    flag,
    arrow_left,
    arrow_right,
    price,
    icon,
    pic,
    title,
    address,
    description,
    availabilities_label,
    subprice_label,
    project_type,
    year,
    ownership_type
  } = props;
  
  const { 
    isDescriptionVisible, 
    displayDescription, 
    toggleDescription 
  } = useDescriptionVisibility();

  return (
    <div className="App">
      <ImageGallery 
        pic={pic}
        title={title}
        flag={flag}
        arrow_left={arrow_left}
        arrow_right={arrow_right}
      />
      
      <div className="mainContent">
        <div className="topContent">
          <PropertyInfo 
            icon={icon}
            title={title}
            address={address}
            project_type={project_type}
            year={year}
            ownership_type={ownership_type}
            availabilities_label={availabilities_label}
          />
          
          <PriceInfo 
            price={price}
            subprice_label={subprice_label}
          />
        </div>

        <Description 
          description={description}
          isVisible={displayDescription}
        />

        <div className="bottomContent">
          <button 
            onClick={toggleDescription}
            aria-expanded={isDescriptionVisible}
            aria-controls="description-section"
          >
            {isDescriptionVisible ? 'Hide description' : 'See description'}
          </button>
        </div>
      </div>
    </div>
  );
}

ListingAd.propTypes = {
  flag: PropTypes.string,
  arrow_left: PropTypes.string.isRequired,
  arrow_right: PropTypes.string.isRequired,
  price: PropTypes.string.isRequired,
  icon: PropTypes.string.isRequired,
  pic: PropTypes.string.isRequired,
  title: PropTypes.string.isRequired,
  address: PropTypes.string.isRequired,
  description: PropTypes.string,
  availabilities_label: PropTypes.string.isRequired,
  subprice_label: PropTypes.string.isRequired,
  project_type: PropTypes.string.isRequired,
  year: PropTypes.oneOfType([PropTypes.string, PropTypes.number]).isRequired,
  ownership_type: PropTypes.string.isRequired
};

ListingAd.defaultProps = {
  flag: null,
  description: ''
};

export default ListingAd;
